{{- if and (index .Values "cloudnative-pg" "enabled") (index .Values "cloudnative-pg" "monitoring" "dashboards") }}
apiVersion: v1
kind: ConfigMap
metadata:
  name: {{ printf "%s-%s" (include "kubezero-lib.fullname" $) "grafana-dashboards-pg" | trunc 63 | trimSuffix "-" }}
  namespace: {{ .Release.Namespace }}
  labels:
    grafana_dashboard: "1"
    {{- include "kubezero-lib.labels" . | nindent 4 }}
  annotations:
    k8s-sidecar-target-directory: Databases
binaryData:
  CloudNativePG.json.gz:
    
{{- end }}
